import React from "react";
import img1 from './images/logo.png';
import './Login.css'

const Login = () =>{
    return(
        <div class = "header">
            <center><img src={img1} alt="" width = "220" length = "320" /></center>
            <hr width = "60%" ></hr>
            <center><input type="text"/></center>
            <center><input type="text"/></center>
            <center><input type="text"/></center>
            <center><input type="text"/></center>
        </div>

    )
}
export default Login
